import { Flex } from '@chakra-ui/react';
import { darkerGrey } from '../../globals/themes';

const NavContainer = ({ children }) => {
    return (
        <Flex                 as="nav"
        align="center"
        justify="center"
        wrap="wrap"
        gap="1rem"
        w="100%"
        position="fixed"
        zIndex={10}
        top={0}
        mb={4}
        pt={4}
        pb={4}
        bg={darkerGrey}
        color="white">
            <Flex
            >
                {children}
            </Flex>
        </Flex>
    );
}

export default NavContainer;
